# ---------------------------------------------------------
# PATHS
# ---------------------------------------------------------

paths:
  # *** file/catia-v5-protool
  /api/v2/file/catia-v5-protool:
    post:
      security:
        - Bearer: []
      tags:
        - File
      summary: Store all data of a catia v5 (protool) file in database
      produces:
      - application/json
      parameters:
      - in: body
        name: Catia v5 Data Storage
        description: Store all data of a Catia v5 export file in database
        required: true   # can also be true depending on user preference
        schema:           # Schema definition
          $ref: '#/definitions/storeCatiaV5Model' 
      - in: query 
        name: password
        description: Post query should not be used in prod; password required.
        required: true
        type: string
      responses:
         200:
          description: Store Catia V5 file Response
          schema:
            type: object
            properties:
              status:
                type: boolean
              message:
               type: string
         404:
           description: Error 404 Page Not found
         401:
           description: Unauthorized content



